import React from 'react'
import './clients.css'
import gsap from 'gsap'


const Client = (props) => {
    return (
        <div className="client">
            <img onMouseOver={()=>{
                gsap.to(".client img", {opacity: 0.1})
            }} src={props.img} alt="" />
        </div>
    )
}

export default Client
